import {
  DensityMedium,
  KeyboardArrowDown,
  Search,
  ShoppingCartOutlined,
} from '@mui/icons-material';
import { Badge } from '@mui/material';
import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  background-color: white;
  padding: 10px 20px;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const Logo = styled.h1`
  font-size: 25px;
  font-weight: 800;
  color: #bd1a1a;
  :hover {
    cursor: pointer;
  }
`;
const Center = styled.div`
  flex: 2;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const SearchContainer = styled.div`
  width: 70%;
  border: 0.5px solid lightgray;
  display: flex;
  align-items: center;
  margin-left: 15px;
  padding: 3px;
  border-radius: 10px;
`;
const Input = styled.input`
  width: 100%;
  font-size: 15px;
  margin-left: 15px;
  border: none;
  &:focus {
    outline: none;
  }
`;
const Button = styled.button`
  padding: 3px 25px;
  border-radius: 10px;
  border: none;
  background-color: #bd1a1a;
  color: white;
  :hover {
    cursor: pointer;
  }
`;
const Right = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: flex-end;
`;
const MenuItem = styled.div`
  font-size: 17px;
  cursor: pointer;
  color: darkgray;
  margin-left: 25px;
  & :hover {
    cursor: pointer;
  }
`;
const Navbar = () => {
  return (
    <Container>
      <Left>
        <Logo>BOOKSTORE</Logo>
      </Left>
      <Center>
        <DensityMedium style={{ color: 'darkgray' }} />
        <KeyboardArrowDown style={{ color: 'darkgray' }} />
        <SearchContainer>
          <Input placeholder="Search..." />
          <Button>
            <Search style={{ fontSize: '20px' }} />
          </Button>
        </SearchContainer>
      </Center>
      <Right>
        <MenuItem>Login</MenuItem>
        <MenuItem>Register</MenuItem>
        <MenuItem>
          <Badge badgeContent={3}>
            <ShoppingCartOutlined style={{ color: 'darkgray' }} />
          </Badge>
        </MenuItem>
      </Right>
    </Container>
  );
};

export default Navbar;
